nfiguration error detected'=>'%s Konfigurationsfehler entdeckt' . "\0" . '%s Konfigurationsfehler entdeckt','There was an error saving the contact form.'=>'Beim Speichern des Kontaktformulars ist ein Fehler aufgetreten.','Hook %1$s is <strong>deprecated</strong> since Contact Form 7 version %2$s! Use %3$s instead.'=>'Der Hook %1$s ist seit Contact Form 7 Version %2$s <strong>veraltet</strong>! Nutze stattdessen %3$s.','Contact Form 7 does not store submitted messages anywhere. Therefore, you may lose important messages forever if your mail server has issues or you make a mistake in mail configuration.'=>'Contact Form 7 speichert die übertragenen Nachrichten nirgends ab. Daher können wichtige Nachrichten verloren gehen, wenn es mit deinem Mailserver Probleme gibt oder du bei der Konfiguration der Mail-Einstellungen Fehler machst.','Before you cry over spilt mail&#8230;'=>'Bevor du über verloren gegangene Mails weinst&nbsp;&hellip;','https://contactform7.com/comment-blacklist/'=>'https://contactform7.com/comment-blacklist/','Spammers target everything; your contact forms are not an exception. Before you get spammed, protect your contact forms with the powerful anti-spam features Contact Form 7 provides.'=>'Spammer nehmen alles ins Visier; deine Kontaktformulare sind da keine Ausnahme. Bevor du zugespammt wirst, schütze deine Kontaktformulare mit den leistungsfähigen Anti-Spam-Funktionen, die Contact Form 7 bietet.','Getting spammed? You have protection.'=>'Wirst du zugespammt? Du bist geschützt.','Multiple form controls are in a single label element.'=>'Mehrere Formularfelder sind in einem einzigen Beschriftungselement platziert.','FAQ about Configuration Validator'=>'FAQ zum Konfigurations-Validator','https://contactform7.com/configuration-validator-faq/'=>'https://contactform7.com/configuration-validator-faq/','The answer to the quiz is incorrect.'=>'Die Antwort auf das Quiz ist falsch.','There was an error uploading the file.'=>'Beim Hochladen der Datei ist ein Fehler aufgetreten.','You are not allowed to upload files of this type.'=>'Es ist nicht erlaubt, Dateien dieses Typs hochzuladen.','There was an unknown error uploading the file.'=>'Beim Hochladen der Datei ist ein unbekannter Fehler aufgetreten.','You must accept the terms and conditions before sending your message.'=>'Du musst die Bedingungen und Konditionen akzeptieren, bevor du deine Nachricht senden kannst.','One or more fields have an error. Please check and try again.'=>'Ein oder mehrere Felder weisen einen Fehler auf. Bitte überprüfe das und versuche es erneut.','There was an error trying to send your message. Please try again later.'=>'Beim Versuch, deine Nachricht zu senden, ist ein Fehler aufgetreten. Bitte versuche es später nochmal.','Thank you for your message. It has been sent.'=>'Vielen Dank für deine Nachricht. Sie wurde gesendet.','mail subject%1$s "%2$s"'=>'%1$s „%2$s“','Misconfiguration leads to mail delivery failure or other troubles. Validate your contact forms now.'=>'Eine Fehlkonfiguration führt zu Fehlern bei der E-Mail-Zustellung oder anderen Problemen. Validiere jetzt deine Kontaktformulare.','Validate Contact Form 7 Configuration'=>'Konfiguration von Contact Form 7 validieren','https://contactform7.com/configuration-errors/'=>'https://contactform7.com/configuration-errors/','Configuration validation completed. No invalid contact form was found.'=>'Validierung der Konfiguration abgeschlossen. Es wurden keine ungültigen Kontaktformulare gefunden.','Configuration validation completed. %s invalid contact form was found.'=>'Validierung der Konfiguration abgeschlossen. %s ungültiges Kontaktformular wurde gefunden.' . "\0" . 'Validierung der Konfiguration abgeschlossen. %s ungültige Kontaktformulare wurden gefunden.','Validate Configuration'=>'Konfiguration validieren','Validate %s contact form now'=>'Jetzt %s Kontaktformular validieren' . "\0" . 'Jetzt %s Kontaktformulare validieren','You are not allowed to validate configuration.'=>'Du hast nicht die Berechtigung, die Konfiguration zu validieren.','https://contactform7.com/recaptcha/'=>'https://contactform7.com/recaptcha/','Secret Key'=>'Geheimer Schlüssel','Site Key'=>'Website-Schlüssel','Settings saved.'=>'Einstellungen gespeichert.','Invalid key values.'=>'Ungültige Schlüsselwerte.','reCAPTCHA'=>'reCAPTCHA','Just another contact form plugin. Simple but flexible.'=>'Nur ein weiteres Kontaktformular-Plugin. Einfach, aber flexibel.','https://contactform7.com/'=>'https://contactform7.com/','Contact form %d'=>'Kontaktformular %d','text area'=>'Textfeld','Akismet'=>'Akismet','Text field'=>'Textfeld','tel'=>'Telefon','URL'=>'URL','email'=>'E-Mail','text'=>'Text','Telephone number that the sender entered is invalid'=>'Die eingegebene Telefonnummer des Absenders ist ungültig','URL that the sender entered is invalid'=>'Die eingegebene URL des Absenders ist ungültig','Email address that the sender entered is invalid'=>'Die eingegebene E-Mail-Adresse des Absenders ist ungültig','Label'=>'Beschriftung','Submit button'=>'Senden-Button','submit'=>'Senden','drop-down menu'=>'Drop-Down Menü','Questions and answers'=>'Fragen und Antworten','Quiz'=>'Quiz','quiz'=>'Quiz','Sender does not enter the correct answer to the quiz'=>'Der Absender gibt nicht die richtige Antwort auf das Quiz ein','Slider'=>'Schieberegler','Spinbox'=>'Spinbox','Number field'=>'Zahlenfeld','number'=>'Zahl','Number is larger than maximum limit'=>'Zahl ist größer als das erlaubte Maximum','Number is smaller than minimum limit'=>'Zahl ist niedriger als das erlaubte Minimum','Number format that the sender entered is invalid'=>'Die eingegebene Zahlenformat ist ungültig','This contact form has file uploading fields, but the temporary folder for the files (%s) does not exist or is not writable. You can create the folder or change its permission manually.'=>'Dieses Kontaktformular enthält Felder zum Hochladen von Dateien, aber der temporäre Ordner für die Dateien (%s) ist nicht vorhanden oder nicht beschreibbar. Du kannst den Ordner anlegen oder seine Berechtigung manuell ändern.','Acceptable file types'=>'Akzeptierte Dateitypen','file'=>'Datei','Uploading a file fails for PHP error'=>'Das Hochladen der Datei verursachte einen PHP-Fehler','Uploaded file is too large'=>'Die hochgeladene Datei ist zu groß','Uploaded file is not allowed for file type'=>'Das Hochladen ist für den Dateityp nicht erlaubt','Uploading a file fails for any reason'=>'Fehler aus unbekannten Gründen beim Hochladen der Datei','Max'=>'Max.','Min'=>'Min.','Range'=>'Bereich','Default value'=>'Standardwert','Date field'=>'Datumsfeld','date'=>'Datum','Date is later than maximum limit'=>'Das Datum liegt nach dem letzten erlaubten Datum','Date is earlier than minimum limit'=>'Das Datum liegt vor dem ersten erlaubten Datum','Date format that the sender entered is invalid'=>'Das eingegebene Datumsformat ist ungültig','Wrap each item with a label element.'=>'Jeden Eintrag mit einer Beschreibung umfassen.','Field type'=>'Feld-Typ','radio buttons'=>'Radio-Buttons','checkboxes'=>'Kontrollkästchen','This contact form contains CAPTCHA fields, but the necessary libraries (GD and FreeType) are not available on your server.'=>'Dieses Kontaktformular enthält Captcha-Felder, aber die benötigten Bibliotheken (GD und FreeType) sind nicht auf deinem Server verfügbar.','This contact form contains CAPTCHA fields, but the temporary folder for the files (%s) does not exist or is not writable. You can create the folder or change its permission manually.'=>'Dieses Kontaktformular enthält CAPTCHA-Felder, aber der temporäre Ordner für die Dateien (%s) ist nicht vorhanden oder nicht beschreibbar. Du kannst den Ordner anlegen oder seine Berechtigung manuell ändern.','Your entered code is incorrect.'=>'Dein eingegebener Code ist falsch.','The code that sender entered does not match the CAPTCHA'=>'Der eingegebene Code stimmt nicht mit dem angezeigten Captcha-Code überein','Insert Tag'=>'Tag einfügen','Class attribute'=>'Klassen-Attribut','ID attribute'=>'ID-Attribut','Acceptance checkbox'=>'Zustimmungs-Checkbox','acceptance'=>'Zustimmung','<code>%1$s</code> property of a <code>WPCF7_ContactForm</code> object is <strong>no longer accessible</strong>. Use <code>%2$s</code> method instead.'=>'<code>%1$s</code> Eigenschaft eines <code>WPCF7_ContactForm</code> Objekts ist <strong>nicht mehr zugänglich</strong>. Verwende <code>%2$s</code> Methode stattdessen.','Untitled'=>'Ohne Titel','Contact Form'=>'Kontaktformular','There is a field with input that is shorter than the minimum allowed length'=>'Es gibt ein Feld, bei dem die Eingabe die Mindestlänge unterschreitet','There is a field with input that is longer than the maximum allowed length'=>'Es gibt ein Feld mit einer Eingabe, die länger als die maximal zulässige Länge ist','There is a field that the sender must fill in'=>'Es gibt ein Feld, das der Absender ausfüllen muss','There are terms that the sender must accept'=>'Es gibt Bedingungen, die der Absender akzeptieren muss','Submission was referred to as spam'=>'Eingabe wurde als Spam erkannt','Validation errors occurred'=>'Fehler beim Ausfüllen des Formulars','Sender&#8217;s message was sent successfully'=>'Die Nachricht des Absenders wurde erfolgreich gesendet.','Message Body:'=>'Nachrichtentext:','Subject: %s'=>'Betreff: %s','From: %s'=>'Von: %s','Send'=>'Senden','Your message'=>'Deine Nachricht','Your email'=>'Deine E-Mail-Adresse','Your name'=>'Dein Name','Form-tag Generator: %s'=>'Formular-Tag-Generator: %s','For more information:'=>'Für weitere Informationen:','Any information you provide will not be shared with service providers without your authorization.'=>'Die von dir bereitgestellten Informationen werden ohne deine Zustimmung nicht an Dienstleister weitergegeben.','You may need to first sign up for an account with the service that you plan to use. When you do so, you would need to authorize Contact Form 7 to access the service with your account.'=>'Möglicherweise musst du dich zunächst mit einem Konto bei dem Dienst registrieren, den du nutzen möchtest. Wenn due dies tust, musst du Contact Form 7 autorisieren, um mit deinem Konto auf den Dienst zugreifen zu können.','On this screen, you can manage services that are available through Contact Form 7. Using API will allow you to collaborate with any services that are available.'=>'In dieser Ansicht kannst du Dienste verwalten, die über Contact Form 7 zur Verfügung stehen. Die Verwendung der API ermöglicht dir, jeden Dienst zu nutzen, der zur Verfügung steht.','There are also special mail-tags that have specific names, but do not have corresponding form-tags. They are used to represent meta information of form submissions like the submitter&#8217;s IP address or the URL of the page.'=>'Es gibt auch spezielle E-Mail-Tags, die bestimmte Namen, aber keine zugehörigen Formular-Tags haben. Sie werden verwendet, um Meta-Informationen von Formularen wie IP-Adresse des Absenders oder die URL der Seite darzustellen.','A mail-tag is also a short code enclosed in square brackets that you can use in every Mail and Mail (2) field. A mail-tag represents a user input value through an input field of a corresponding form-tag.'=>'Ein E-Mail-Tag ist auch ein Shortcode in eckigen Klammern, den du in jeder E-Mail und E-Mail (2) verwenden kannst. Ein Mail-Tag entspricht einem Benutzer-Eingabewert über ein Eingabefeld eines zugehörigen Formular-Tags.','While form-tags have a comparatively complex syntax, you do not need to know the syntax to add form-tags because you can use the straightforward tag generator (<strong>Generate Tag</strong> button on this screen).'=>'Weil Formular-Tags eine vergleichsweise komplexe Syntax haben, brauchst du die Syntax zum Hinzufügen von Formular-Tags nicht zu kennen, da du einfach den jeweiligen Tag-Generator <strong>Button</strong> auf diesem Bildschirm verwenden kannst.','A form-tag is a short code enclosed in square brackets used in a form content. A form-tag generally represents an input field, and its components can be separated into four parts: type, name, options, and values. Contact Form 7 supports several types of form-tags including text fields, number fields, date fields, checkboxes, radio buttons, menus, file-uploading fields, CAPTCHAs, and quiz fields.'=>'Ein Formular-Tag ist ein Shortcode in eckigen Klammern, den du in Formularen verwenden kannst. Ein Formular-Tag ist in der Regel ein Eingabefeld und seine Komponenten werden in vier Teile getrennt: Typ, Name, Optionen und Werte. Contact Form 7 unterstützt mehrere Arten von Formular-Tags, einschließlich Textfelder, Zahlenfelder, Datumsfelder, Checkboxen, Radio-Buttons, Menüs, Felder zum Hochladen von Dateien, CAPTCHAs und Quiz-Felder.','<strong>Additional Settings</strong> provides a place where you can customize the behavior of this contact form by adding code snippets.'=>'<strong>Zusätzliche Einstellungen</strong> - Bietet eine Möglichkeit, um das Verhalten des Kontaktformulars zu ändern, indem du Code-Schnipsel hinzufügst.','In <strong>Messages</strong>, you can edit various types of messages used for this contact form. These messages are relatively short messages, like a validation error message you see when you leave a required field blank.'=>'Unter <strong>Meldungen</strong> kannst du verschiedene Arten von Mitteilungen bearbeiten, die für das Kontaktformular verwendet werden. Diese Meldungen sind vergleichsweise kurze Meldungen, wie beispielsweise ein Hinweis auf einen Validierungsfehler, der angezeigt wird, wenn du ein Pflichtfeld frei lässt.','<strong>Mail (2)</strong> is an additional mail template that works similar to Mail. Mail (2) is different in that it is sent only when Mail has been sent successfully.'=>'<strong>E-Mail (2)</strong> - Ist eine zusätzliche E-Mail-Vorlage, die ähnlich wie E-Mail funktioniert. Der Unterschied ist, dass E-Mail (2) nur bei Erfolg von E-Mail versendet wird.','<strong>Mail</strong> manages a mail template (headers and message body) that this contact form will send when users submit it. You can use Contact Form 7&#8217;s mail-tags here.'=>'<strong>E-Mail</strong> - Verwaltet eine E-Mail-Vorlage (Kopfzeilen und Nachrichtentext), die dieses Kontaktformular versendet, wenn Benutzer es abschicken. Du kannst hier E-Mail-Tags von Contact Form 7 verwenden.','<strong>Form</strong> is a content of HTML form. You can use arbitrary HTML, which is allowed inside a form element. You can also use Contact Form 7&#8217;s form-tags here.'=>'<strong>Formular</strong> - Ist der Inhalt eines HTML-Formulars. Du kannst beliebiges HTML, das in einem Formularelement erlaubt ist, verwenden. Du kannst hier auch Formular-Tags von Contact Form 7 verwenden.','<strong>Title</strong> is the title of a contact form. This title is only used for labeling a contact form, and can be edited.'=>'<strong>Titel</strong> - Ist der Titel eines Kontaktformulars. Dieser Titel ist nur für die Bezeichnung eines Formulars und kann bearbeitet bzw. geändert werden.','On this screen, you can edit a contact form. A contact form is comprised of the following components:'=>'In dieser Ansicht kannst du ein Kontaktformular bearbeiten. Ein Formular setzt sich aus folgenden Komponenten zusammen:','<strong>Duplicate</strong> - Clones that contact form. A cloned contact form inherits all content from the original, but has a different ID.'=>'<strong>Kopieren</strong> - Kopiert das Kontaktformular. Ein kopiertes Formular erbt alle Inhalte, besitzt aber eine andere ID.','<strong>Edit</strong> - Navigates to the editing screen for that contact form. You can also reach that screen by clicking on the contact form title.'=>'<strong>Bearbeiten</strong> - Wechselt in den Bearbeitungs-Modus des Kontaktformulars. Du erhältst diese Ansicht auch durch Anklicken des Formular-Titels.','Hovering over a row in the contact forms list will display action links that allow you to manage your contact form. You can perform the following actions:'=>'Durch Bewegen des Mauszeigers über eine Zeile in den Kontaktformularen werden Aktions-Links angezeigt, die dir ermöglichen, dein Formular zu verwalten. Du kannst folgende Aktionen durchführen:','On this screen, you can manage contact forms provided by Contact Form 7. You can manage an unlimited number of contact forms. Each contact form has a unique ID and Contact Form 7 shortcode ([contact-form-7 ...]). To insert a contact form into a post or a text widget, insert the shortcode into the target.'=>'In dieser Ansicht kannst du Kontaktformulare von Contact Form 7 verwalten. Du kannst eine unbegrenzte Anzahl von Kontaktformularen verwalten. Jedes Formular hat eine eindeutige ID und einen Shortcode von Contact Form 7 ([contact-form-7 ...]). Um ein Kontaktformular in einen Beitrag oder ein Text-Widget einzufügen, kopiere den Shortcode in das jeweilige Ziel (Seite, Beitrag, usw.).','Mail-tags'=>'E-Mail-Tags','Form-tags'=>'Formular-Tags','Available Actions'=>'Verfügbare Aktionen','Overview'=>'Übersicht','https://contactform7.com/additional-settings/'=>'https://contactform7.com/additional-settings/','File attachments'=>'Dateianhänge','Use HTML content type'=>'HTML-Content-Typ verwenden','Exclude lines with blank mail-tags from output'=>'Zeilen mit leeren E-Mail-Tags von Ausgabe ausschließen','Message body'=>'Nachrichtentext','Additional headers'=>'Zusätzliche Kopfzeilen','Subject'=>'Betreff','From'=>'Von','To'=>'An','In the following fields, you can use these mail-tags:'=>'In den folgenden Feldern kannst du diese E-Mail-Tags verwenden:','Mail (2) is an additional mail template often used as an autoresponder.'=>'E-Mail (2) ist ein zusätzliche E-Mail-Vorlage, die häufig als Autoresponder verwendet wird.','Use Mail (2)'=>'E-Mail (2) verwenden','Mail (2)'=>'E-Mail (2)','Y/m/d'=>'d.m.Y','Edit &#8220;%s&#8221;'=>'„%s“ bearbeiten','Edit'=>'Bearbeiten','Date'=>'Datum','Author'=>'Autor','Shortcode'=>'Shortcode','Title'=>'Titel','Additional Settings'=>'Zusätzliche Einstellungen','Additional Settings (%d)'=>'Zusätzliche Einstellungen (%d)','Messages'=>'Meldungen','Mail'=>'E-Mail','Form'=>'Formular','Support'=>'Support','https://contactform7.com/support/'=>'https://contactform7.com/support/','FAQ'=>'Häufig gestellte Fragen','https://contactform7.com/faq/'=>'https://contactform7.com/faq/','Docs'=>'Dokumente','https://contactform7.com/docs/'=>'https://contactform7.com/docs/','Delete'=>'Löschen','Duplicate'=>'Kopieren','Status'=>'Status','You can also use this old-style shortcode:'=>'Du kannst auch diesen Shortcode im alten Stil verwenden:','Copy this shortcode and paste it into your post, page, or text widget content:'=>'Kopiere diesen Shortcode und füge ihn in den Inhalt einer Seite, eines Beitrags oder eines Text-Widgets ein:','Enter title here'=>'Titel hier eingeben','Save'=>'Speichern','You are not allowed to edit this contact form.'=>'Du bist nicht berechtigt, dieses Kontaktformular zu bearbeiten.','https://contactform7.com/save-submitted-messages-with-flamingo/'=>'https://contactform7.com/save-submitted-messages-with-flamingo/','Spam filtering with Akismet'=>'Spam-Filterung mit Akismet','https://contactform7.com/spam-filtering-with-akismet/'=>'https://contactform7.com/spam-filtering-with-akismet/','https://contactform7.com/setting-up-mail/'=>'https://contactform7.com/setting-up-mail/','Contact Form 7 needs your support.'=>'Contact Form 7 braucht deine Unterstützung.','Dismiss'=>'Verwerfen','<strong>Contact Form 7 %1$s requires WordPress %2$s or higher.</strong> Please <a href="%3$s">update WordPress</a> first.'=>'<strong>Contact Form 7 %1$s erfordert WordPress %2$s oder höher.</strong> Bitte <a href="%3$s">aktualisiere WordPress</a> zuerst.','Settings'=>'Einstellungen','Contact form deleted.'=>'Kontaktformular gelöscht.','Contact form saved.'=>'Kontaktformular gespeichert.','Contact form created.'=>'Kontaktformular erstellt.','Search Contact Forms'=>'Formulare durchsuchen','Error in deleting.'=>'Fehler beim Löschen.','You are not allowed to delete this item.'=>'Du bist nicht berechtigt, dieses Formular zu löschen.','You are not allowed to edit this item.'=>'Du bist nicht berechtigt, dieses Formular zu bearbeiten.','Integration'=>'Integration','Contact Forms'=>'Kontaktformulare','Edit Contact Form'=>'Kontaktformular bearbeiten','Contact'=>'Formulare','Contact Form 7'=>'Contact Form 7']];